import React, { useEffect } from "react";
import { BrowserRouter, Route, Link } from "react-router-dom";
import { useDispatch } from "react-redux";
import "./App.css";
import AddContact from "./components/AddContact";
import ContactCard from "./components/ContactCard";
import { getContacts } from "./js/actions/actionsContact";

function App() {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getContacts());
    console.log(getContacts());
  }, []);
  return (
    <BrowserRouter>
      <div>
        <Link to="/Contact-list">
          <button className="button">Contact List</button>
        </Link>
        <Link to="/Add-contact">
          <button className="button">Add Contact</button>
        </Link>
      </div>
      <Route path="/Contact-list" render={() => <ContactCard />} />
      <Route path="/Add-contact" render={() => <AddContact />} />
    </BrowserRouter>
  );
}

export default App;
